import React, {Component} from 'react';

class Car extends Component {
    render() {
        return (
            <div className='car-wrapper'>
                <p>Car</p>
                <p>{1 + 1}</p>
                <p>Car name: {'Car Name'}</p>
            </div>
        )
    }
}

export default Car
